            //split into double array
            List<List<char>> table = new List<List<char>>();
            string[] lines = puzzle.Split("\r\n");

            foreach (string line in lines)
            {
                table.Add(line.ToCharArray().ToList());
            }

            //
            string word = "MAS";
            int[] dx = new int[] { 1, 0, -1 };
            int count = 0;

            //Search at table
            for (int y = 0; y < table.Count; y++)
            {
                for (int x = 0; x < table[y].Count; x++)
                {
                    if (table[y][x] == word[0])
                    {
                        //Add the default coordinates to current to check around the letter
                        foreach (var coordinateX in dx)
                        {
                            //check if this coordinate oversize the table
                            int xCheck = coordinateX * (word.Length - 1) + x;
                            if (xCheck < 0 || xCheck >= table[y].Count)
                            { continue; }
                            foreach (var coordinateY in dx)
                            {
                                //check if this coordinate oversize the table
                                int yCheck = coordinateY * (word.Length - 1) + y;
                                if (yCheck < 0 || yCheck >= table.Count)
                                { continue; }

                                int xToUpdate = xCheck;
                                int yToUpdate = yCheck;

                                //Check the letter
                                for (int nextLetter = word.Length - 1; nextLetter > 0; nextLetter--)
                                {
                                    if (table[yToUpdate][xToUpdate] == word[nextLetter])
                                    {
                                        yToUpdate -= coordinateY;
                                        xToUpdate -= coordinateX;
                                        //Check
                                        if (nextLetter == 1)
                                        {
                                            count++;
                                            break;
                                        }
                                    }
                                    else
                                    {
                                        break;
                                    }

                                }
                            }

                        }
                    }

                }
            }

            Console.WriteLine("Result:" + count);

        }
    }
